import React from 'react'

export const GifExpertApp = () => {

    const categories = ['One Punch Man','Koi to Uso', 'shigatsu wa kimi no uso']

    return (
        <>
            <h2>GifExpertApp</h2>
            <hr />

        <ol>
            {
                categories.map( category => {
                    return <li key= {category}> {category} </li>
                })
            }
        </ol>

        </>

    )
}
